type ChatModelVision struct {
	Model     string                        `json:"model"`
	MaxTokens int                           `json:"max_tokens"`
	Messages  []ChatCompletionMessageVision `json:"messages"`
	// ResponseFormat ResponseFormat                `json:"response_format"`
}

type ChatCompletionMessageVision struct {
	Role    string        `json:"role"`
	Content []ContentItem `json:"content"`
	Name    string        `json:"name,omitempty"`
}

// ContentItem 代表 "content" 数组中的每个项目
type ContentItem struct {
	Type     string    `json:"type"`
	Text     string    `json:"text,omitempty"`
	ImageURL *ImageURL `json:"image_url,omitempty"`
}

// ImageURL 代表图片的URL
type ImageURL struct {
	URL string `json:"url"`
}

// GetChatCompletions godoc
// @Summary  GPT-4.0模型聊天对话(Vision版本)
// @Description 暂时不支持上下文
// @Tags   GPT
//
// @Produce  json
//
// @Router       /openai/getChatCompletions [post]
func GetChatCompletionWithVisions(ctx *gin.Context) dto.ResponseResult {

	// 通过GetRawData获取前端传递的JSON数据结构
	data, _ := ctx.GetRawData()

	// 将data数据 包装成json数据
	var m map[string]interface{}
	_ = json.Unmarshal(data, &m)

	// 这里我定义的参数是content获取传入的参数
	content := m["content"].(string)
	fmt.Printf(content)

	contents := make([]ContentItem, 0)

	contentItem := ContentItem{
		Type: "text",
		Text: "Please, based on the UI of the image, help me convert the page into frontend code, using Vue3 and the component library Element-Plus.?  Finally  translate the result into Chinese again. ",
	}

	imageItem := ContentItem{
		Type:     "image_url",
		ImageURL: &ImageURL{URL: "data:image/png;base64,"},
	}

	contents = append(contents, contentItem)
	contents = append(contents, imageItem)

	messages := make([]ChatCompletionMessageVision, 0)

	messages = append(messages, ChatCompletionMessageVision{
		Role:    "user",
		Content: contents,
	})

	resp := GetChatCompletionsApi_WithVision(messages, "gpt-4-vision-preview")
	// resp := GetChatCompletionsApi(messages, "gpt-3.5-turbo-0613")
	// 组装openai 接口的参数实体
	// gpt-4   gpt-3.5-turbo

	// 将返回对象中的body数据转换为json数据
	var obj map[string]interface{}
	if err := json.Unmarshal(resp, &obj); err != nil {
		panic(err)
	}
	fmt.Println("Body:", obj)

	// 最后我通过一个方法进行统一返回参数处理
	return dto.SetResponseData(obj)
}

type TextToSpeechModel struct {
	Model string `json:"model"`
	Input string `json:"input"`
	Voice string `json:"voice"`
}

// getTextToSpecch godoc
// @Summary  文本转换为语音
// @Description 支持6中口音
// @Tags   GPT
//
// @Produce  json
//
// @Router       /openai/getTextToSpecch [post]
func GetTextToSpeech(ctx *gin.Context) dto.ResponseResult {
	data, _ := ctx.GetRawData()
	var m map[string]interface{}
	_ = json.Unmarshal(data, &m)

	content := m["content"].(string)
	fmt.Printf(content)

	textToSpeechModel := TextToSpeechModel{
		Model: "tts-1-1106",
		Input: content,
		Voice: "alloy",
	}

	bytes, err := json.Marshal(textToSpeechModel)
	if err != nil {
		fmt.Println("error:", err)
		// return dto.SetResponseFailure("数据转换错误")
	}

	result := utils.SendRequest("https://api.openai.com/v1/audio/speech", bytes)
	fmt.Println(string(result), "result")
	return dto.SetResponseData(result)
}

func GetChatCompletionsApi_WithVision(messages []ChatCompletionMessageVision, apiModel string) []byte {
	var model string
	if utils.GptConfig.Type == "openai" {
		model = apiModel
	} else {
		model = "gpt-35-turbo"
	}

	// responseFormat := ResponseFormat{
	// 	Type: "json_object",
	// }

	chatModel := ChatModelVision{
		Model:     model,
		MaxTokens: 4096,
		Messages:  messages,
		// ResponseFormat: responseFormat,
	}

	// 将实体结构转换为byte数组
	bytes, err := json.Marshal(chatModel)

	fmt.Println(string(bytes), "bytes")
	if err != nil {
		fmt.Println("error:", err)
		// return dto.SetResponseFailure("数据转换错误")
	}

	// openai接口地址，可通过代理处理
	var url string
	if utils.GptConfig.Type == "openai" {
		url = utils.GptConfig.Url + `/v1/chat/completions`
	} else {
		url = utils.GptConfig.Url + `/openai/deployments/ChatGPT/chat/completions?api-version=2023-03-15-preview`
	}

	return utils.SendRequest(url, bytes)
}

